    false,nt"url": null,nt"notes": "BPI Zones are derived from a focal mean
    analysis on bathymetry and slope. The grid is based on gridded (5 m cell size) multibeam
    bathymetry, collected aboard NOAA Ship Hiialaka'i and R/V AHI, and it was created
    using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/). Cell
    values represent one of 4 classes (crest, depression, flat, slope) in an index of
    seafloor terrains. This data set is for the shelf and slope environments of French
    Frigate Shoals, Hawaii, USA.",nt"license_title": null,nt"extras": [{ntt"key":
